import React from 'react'
import "./App.css"
import ProductCard from './components/ProductCard'



const App = () => {

  const RandomPrice = () => {
    return (`${Math.round(Math.random() * 1000)}$`)
  }

  let productId = 0;

  const products = [
    {
      title: 'apple',
      price: RandomPrice(),
      imgUrl: 'https://avatars.mds.yandex.net/i?id=1518cd415a3c3c6eb039a336a1f3dff3_sr-5313814-images-thumbs&n=13',
      id: ++productId,
      discount: (Math.random * 1) * 10
    },
    {
      title: 'orange',
      price: RandomPrice(),
      imgUrl: 'https://cs13.pikabu.ru/avatars/2742/x2742233-1640397636.png',
      id: productId++
    },
    {
      title: 'kiwi',
      price: RandomPrice(),
      imgUrl: 'https://i.pinimg.com/236x/a8/6a/5f/a86a5fa32024de0e5e426d38cddee366.jpg?nii=t',
      id: productId++
    },
    {
      title: 'melon',
      price: RandomPrice(),
      imgUrl: 'https://avatars.mds.yandex.net/i?id=db710c1bbdf640dbeb41e9054034b29f_sr-5175466-images-thumbs&n=13',
      id: productId++
    }
  ]

  return (
    <div>
      {
        products.map(el => <ProductCard {...el} key={el.id} />)
      }


    </div>
  )
}

export default App
